lld ad(lld n){
	lld k,ans = 0;
	lld m = sqrt(n);
	for(k=1;k<=m;k++){
		ans += (lld)n/k;
	}
	ans *= 2;
	ans -= (m*m);
	return ans;
}

lld solve(lld n){
	lld i = 0;
	lld ans = 0;
	lld a,b,c,d,k,j;

	for(i=1;i<((n+1)/2);i++){
		a = i;
		d = n-i;
		k = a * d;
			ans += ad(k-1);
		// cout << "ans += " << ans << endl ;
	}
	ans = ans * 2;

	if(n%2 == 0) //if not odd
		ans += ad( ((n/2)*(n/2)) - 1 );
	// ans *= 2;
	// if( (2 * (int)(n/2)) == n ){
	// 	ans += ad((n/2 * (n/2))-1);
	// }
	return ans;
}
 
